{# ---------- Count prompt_template_name occurrences ---------- #}
{%- set names = {} -%}
{%- for row in results -%}
    {%- set cb_dict = row.get("codeBlocks", {}) -%}
    {%- for cb_val in cb_dict.values() -%}
        {# If cb_val is already a dict, no need to parse JSON #}
        {%- if cb_val is mapping and cb_val.get("prompt_template_name") -%}
            {%- set name = cb_val["prompt_template_name"] -%}
            {%- set _ = names.update({name: (names.get(name, 0) + 1)}) -%}
        {%- endif -%}
    {%- endfor -%}
{%- endfor -%}

{# ---------- Output results ---------- #}
{%- if names -%}
<div style='overflow: auto; width: 100%; height: 100%;'>
<table style='border-collapse: collapse; width: 100%; height: 100%;'>
<tr style='border-bottom: 2px solid #000;'>
  <th>Prompt Template Name</th>
  <th>Count</th>
</tr>
{%- for name, count in names | dictsort(by='value', reverse=True) -%}
  <tr style='border-bottom: 1px solid #ccc;'>
    <td><b>{{ name }}</b></td>
    <td>{{ count }}</td>
  </tr>
{%- endfor -%}
</table>
</div>
{%- else -%}
<p>No <code>prompt_template_name</code> found in any codeBlocks.</p>
{%- endif -%}
