            .split('"C0"', 1)[1]
            .split(":", 1)[1]
            .lstrip()
            .lstrip('"')
            .rstrip('"}')
            .replace('\\\\n', '\n')
            .replace('\\"', '"')
        -%}

        CODEBLOCK C0 CONTENT:
        {{ c0_content }}

        {# Step 2: Extract prompt_template_name from C0 content #}
        {%- if '"prompt_template_name"' in c0_content -%}
            {%- set extracted = c0_content
                .split('"prompt_template_name"', 1)[1]
                .split(":", 1)[1]
                .strip()
                .strip('{}')
                .replace('"', '')
                .replace(',', '')
                .strip()
            -%}
            Found prompt_template_name: {{ extracted }}

            {%- if extracted not in names -%}
                {%- set _ = names.update({extracted: 1}) -%}
            {%- else -%}
                {%- set _ = names.update({extracted: names[extracted] + 1 }) -%}
            {%- endif -%}
        {%- else -%}
            No prompt_template_name found in C0.
        {%- endif -%}

    {%- else -%}
        No C0 field found in codeBlocks.
    {%- endif -%}

{%- else -%}
    No codeBlocks found.
{%- endif -%}
{%- endfor -%}

